import {
  StyleSheet,
} from 'react-native'

export default StyleSheet.create({
  imageOverlay: {
    ...StyleSheet.absoluteFillObject,
    backgroundColor: '#ecf0f1',
  },
  centerSection: {
    justifyContent: 'center',
    alignItems: 'center',
  }
});
